    const [crew,setCrew]=useState(null)

    useEffect(() => {
        axios.get('http://localhost:8000/server/pirates')
            .then(res => {
                console.log(res.data)
                setCrew(res.data)
                console.log(crew)
            }).catch(err => {
                console.log(err)
                setCrew("")
            })
    }, [])


  return <div>Display</div>;
};

